import React, { useState, useEffect } from 'react';
import { Row, Col, Card, Container, ProgressBar } from 'react-bootstrap';
import Message from '../components/Message';
import Loader from '../components/Loader';
import { orderAPI } from '../api/orderAPI';
import { productAPI } from '../api/productAPI';
import { userAPI } from '../api/userAPI';

const AdminDashboard = () => {
  const [stats, setStats] = useState({
    totalOrders: 0,
    totalProducts: 0,
    totalUsers: 0,
    totalRevenue: 0,
    recentOrders: 0,
    lowStockProducts: 0,
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchStats = async () => {
      try {
        setLoading(true);

        // Fetch all data
        const [orders, products, users] = await Promise.all([
          orderAPI.getAllOrders(),
          productAPI.getAllProducts(),
          userAPI.getAllUsers(),
        ]);

        // Calculate stats
        const totalRevenue = orders.reduce((acc, order) => 
          order.isPaid ? acc + order.totalPrice : acc, 0
        );

        const recentOrders = orders.filter(order => {
          const orderDate = new Date(order.createdAt);
          const weekAgo = new Date();
          weekAgo.setDate(weekAgo.getDate() - 7);
          return orderDate >= weekAgo;
        }).length;

        const lowStockProducts = products.filter(product => product.countInStock < 10).length;

        setStats({
          totalOrders: orders.length,
          totalProducts: products.length,
          totalUsers: users.length,
          totalRevenue: totalRevenue.toFixed(2),
          recentOrders,
          lowStockProducts,
        });
      } catch (error) {
        setError(error.response?.data?.message || error.message);
      } finally {
        setLoading(false);
      }
    };

    fetchStats();
  }, []);

  const StatCard = ({ title, value, icon, color, delay, subtitle, progress }) => (
    <Col xl={3} md={6} className="mb-4">
      <Card className={`stat-card h-100 fade-in shadow-hover`} style={{ animationDelay: `${delay}s` }}>
        <Card.Body>
          <div className="d-flex align-items-center">
            <div className={`stat-icon bg-${color}`}>
              <i className={`fas ${icon} fa-2x text-white`}></i>
            </div>
            <div className="ms-3 flex-grow-1">
              <div className="stat-number">{value}</div>
              <div className="stat-title">{title}</div>
              {subtitle && <small className="text-muted">{subtitle}</small>}
              {progress !== undefined && (
                <ProgressBar 
                  variant={color} 
                  now={progress} 
                  className="mt-2"
                  style={{ height: '4px' }}
                />
              )}
            </div>
          </div>
        </Card.Body>
      </Card>
    </Col>
  );

  if (loading) return (
    <Container>
      <div className="text-center my-5">
        <Loader />
      </div>
    </Container>
  );

  if (error) return (
    <Container>
      <Message variant="danger">{error}</Message>
    </Container>
  );

  return (
    <Container fluid>
      <div className="dashboard-header fade-in mb-4">
        <h1 className="display-4 fw-bold text-gradient">
          <i className="fas fa-tachometer-alt me-3"></i>
          Admin Dashboard
        </h1>
        <p className="lead text-muted">Welcome back! Here's what's happening with your store today.</p>
      </div>

      <Row>
        <StatCard
          title="Total Orders"
          value={stats.totalOrders}
          icon="fa-shopping-bag"
          color="primary"
          delay={0.1}
          subtitle={`${stats.recentOrders} this week`}
          progress={75}
        />

        <StatCard
          title="Total Revenue"
          value={`$${stats.totalRevenue}`}
          icon="fa-dollar-sign"
          color="success"
          delay={0.2}
          subtitle="Total earnings"
          progress={85}
        />

        <StatCard
          title="Total Products"
          value={stats.totalProducts}
          icon="fa-box"
          color="info"
          delay={0.3}
          subtitle={`${stats.lowStockProducts} low stock`}
          progress={60}
        />

        <StatCard
          title="Total Users"
          value={stats.totalUsers}
          icon="fa-users"
          color="warning"
          delay={0.4}
          subtitle="Registered customers"
          progress={90}
        />
      </Row>

      {/* Quick Actions */}
      <Row className="mt-5 fade-in" style={{ animationDelay: '0.5s' }}>
        <Col>
          <Card className="quick-actions-card">
            <Card.Header>
              <h4 className="mb-0">
                <i className="fas fa-bolt me-2"></i>
                Quick Actions
              </h4>
            </Card.Header>
            <Card.Body>
              <Row>
                <Col md={3} className="text-center mb-3">
                  <div className="quick-action-item">
                    <div className="quick-action-icon bg-primary">
                      <i className="fas fa-plus fa-2x text-white"></i>
                    </div>
                    <h6 className="mt-2">Add Product</h6>
                  </div>
                </Col>
                <Col md={3} className="text-center mb-3">
                  <div className="quick-action-item">
                    <div className="quick-action-icon bg-success">
                      <i className="fas fa-eye fa-2x text-white"></i>
                    </div>
                    <h6 className="mt-2">View Orders</h6>
                  </div>
                </Col>
                <Col md={3} className="text-center mb-3">
                  <div className="quick-action-item">
                    <div className="quick-action-icon bg-info">
                      <i className="fas fa-chart-bar fa-2x text-white"></i>
                    </div>
                    <h6 className="mt-2">Analytics</h6>
                  </div>
                </Col>
                <Col md={3} className="text-center mb-3">
                  <div className="quick-action-item">
                    <div className="quick-action-icon bg-warning">
                      <i className="fas fa-cog fa-2x text-white"></i>
                    </div>
                    <h6 className="mt-2">Settings</h6>
                  </div>
                </Col>
              </Row>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default AdminDashboard;
